Bank Account ADT As in the lecture notes, simulating ADTs in Python can be done either with an (abstract) class, or a type alias. In our case, we shall use the latter. First, we create the type: type BankAccount = NormalAccount | MinimalAccount Then, we create the NormalAccount and MinimalAccount classes: from dataclasses import dataclass @dataclass(frozen=True)
class NormalAccount: account_id: str balance: float interest_rate: float @dataclass(frozen=True)
class MinimalAccount: account_id: str balance: float interest_rate: float Basic Features For our two basic features, we shall employ a simple helper function that sets the amount of a bank account. Notice once again that we do not mutate any data structure in our program! def _set_balance(amt: float, b: BankAccount) -> BankAccount: match b: case NormalAccount(id, _, i): return NormalAccount(id, amt, i) case MinimalAccount(id, _, i): return MinimalAccount(id, amt, i) Then, the basic features can be defined in terms of our _set_balance helper function. def deposit(amt: float, b: BankAccount) -> BankAccount: return _set_balance(b.balance + amt, b) def deduct(amt: float, b: BankAccount) -> tuple[bool, BankAccount]: if amt > b.balance: return (False, b) return (True, _set_balance(b.balance - amt, b)) Advanced Features At this point, implementing the advanced features should not be too difficult. def _cmpd(p: float, r: float) -> float: return p * (1 + r) def compound(b: BankAccount) -> BankAccount: match b: case NormalAccount(id, bal, i): return NormalAccount(id, _cmpd(bal, i), i) case MinimalAccount(id, bal, i): new_bal: float = max(bal - 20, 0) if bal < 1000 else bal return MinimalAccount(id, _cmpd(new_bal, i), i) def transfer(amt: float, from_: BankAccount, to: BankAccount) -> tuple[bool, BankAccount, BankAccount]: success: bool from_deducted: BankAccount success, from_deducted = deduct(amt, from_) if not success: return (False, from_, to) return (True, from_deducted, deposit(amt, to))

