When should we define polymorphic types or functions? As we have shown, when the implementations of classes, data types, functions etc. are the same except for the types, then we are able to parameterize the differing types which makes the class/data type/function polymorphic! Knowing immediately when to create polymorphic types/functions takes some practice, so to start, just create specialized versions of those types/functions, and as the need arises, make them polymorphic by parameterizing the appropriate types. For example, suppose we are trying to create a Tree class that represents binary trees. Should this class be polymorphic? For now, let's ignore this fact and proceed to create a naive implementation of this class. Further suppose we are expecting to create a tree of integers, so we shall let that be the type of the values of our tree. @dataclass
class IntTree: pass
@dataclass
class IntNode(IntTree): left: IntTree value: int right: IntTree
@dataclass
class IntLeaf(IntTree): value: int Looks great! From this class we are able to create binary trees of integers, for example, IntNode(IntLeaf(1), 2, IntLeaf(3)) gives a binary tree with preorder 2, 1 and 3. Further suppose later on we need to store strings in a binary tree. Again, let's naively implement a separate class that does so: @dataclass
class StrTree: pass
@dataclass
class StrNode(StrTree): left: StrTree value: str right: StrTree
@dataclass
class StrLeaf(StrTree): value: str Once again, notice that the implementations of the classes are identical, and the only difference is in the types! This is one clear example where we should make our class polymorphic! @dataclass
class Tree[a]: pass
@dataclass
class Node[a](Tree[a]): left: Tree[a] value: a right: Tree[a]
@dataclass
class Leaf[a](Tree[a]): value: a Now from this one class, we are able to create all kinds of trees! As another example, suppose we are trying to define a function that reverses a list. Once again, we have to be specific with the type of this function. Temporarily, we shall create a function that works on lists of integers: def reverse_int(ls: list[int]) -> list[int]: return [] if not ls else \ reverse_int(ls[1:]) + [ls[0]] Then, later on we might have to define a similar function that reverses lists of strings: def reverse_str(ls: list[str]) -> list[str]: return [] if not ls else \ reverse_str(ls[1:]) + [ls[0]] Once again, we can see that the implementations of the two functions are identical, and only the types are different. Make this function polymorphic! def reverse[a](ls: list[a]) -> list[a]: return [] if not ls else \ reverse(ls[1:]) + [ls[0]] The two examples above give us some scenarios where we discover that we have to make a class or function polymorphic. More importantly, we see that the implementations across the specialized versions of the class/function are equal, and only the types differ. One key insight we can draw from this is: a class/function should be made polymorphic if its implementation is independent of the type(s) it is representing/acting on. These are the three axes that form the lambda cube , with the simply typed lambda calculus only having terms that depend on terms, and the Calculus of Constructions having types and terms depending on types and terms. The word polymorphism can be broken down into poly (many) and morphism (shape). The word is not just used in Computer Science, but in other areas like biology and pharmacology. Within Computer Science itself there are several kinds of polymorphism, and we shall investigate the most common ones in this lecture and in later lectures too. Finally, polymorphism in Computer Science is really about things taking on different forms, but I suspect that our description of parametric polymorphism gives a pretty good picture of what it entails.

